import React from 'react';
import Task from './Task';

function Tasks({ tasks, handleTaskClick, handleTaskDeletion }) {
    console.log(tasks)
    return (
        <>
            {tasks.map(task => <Task
                key={task.id}
                task={task} 
                handleTaskClick={handleTaskClick} 
                handleTaskDeletion={handleTaskDeletion}
            />)}
        </>
    );
}

export default Tasks;
